massl:
  keystore:
    file: ""
    password: "password"
  truststore:
    file: ""
    password: "changeit"

jwt:
  keystore:
    file: ""
    password: "password"

micro:
  token:
    audience: p2o-microservice
    issuer: okapi2.telstra-org003.slot2.b2c-services
    jwks-static-flag: false
    jwks-https-endpoint: https://slot2.org003.t-dev.corp.telstra.com/v1/okapi-microauth/keys?realm=b2c-services

microtokenvalidator:
  claims:
    profiles:
      - profile: customer_user_tdi_guid
        required:
          - b2c_uid
        derived:
          - userIdentity: b2c_uid
      - profile: staff_user
        required:
          - staff_userid
        derived:
          - userIdentity: staff_userid

enableCacheKeyGeneration: false
redis:
  timeToLive:
    in:
      hours: 1
  default:
    service: p2o-demo-elasticache
  cacheName:
    service:
      mapping: |
        {
          "p2o-demo-elasticache" : [
          "demostate"
          ]
        }
